import java.io.BufferedReader;
import java.io.FileNotFoundException;
import java.io.FileReader;
import java.io.IOException;
import java.util.ArrayList;
import java.util.HashMap;

public class CSVReader {

    public ArrayList readFile() {

        String file = "path/to/file.csv";
        BufferedReader br = null;
        String line = null;
        String[] country = null;
        ArrayList<HashMap<String, String>> listOfCountries = new ArrayList<HashMap<String, String>>();
        HashMap<String, String> mapOfCountry = null;

        try {
            br = new BufferedReader(new FileReader(file));
            while ((line = br.readLine()) != null) {
                country = line.split(",");
                mapOfCountry = new HashMap<String, String>();
                mapOfCountry.put("column0", country[0]);
                mapOfCountry.put("column1", country[1]);
                mapOfCountry.put("column2", country[2]);
                listOfCountries.add(mapOfCountry);
            }
            return listOfCountries;
        } catch (FileNotFoundException e) {
            e.printStackTrace();
        } catch (IOException e) {
            e.printStackTrace();
        } finally {
            if (br != null) {
                try {
                    br.close();
                } catch (IOException e) {
                    e.printStackTrace();
                }
            }
        }
        return null;
    }
}

